@test integrate(csc(a+b*x)^-1//2*sec(a+b*x)^3, x) == :(1//4*b^-1*arctan(csc(a+b*x)^(1/2))+1//4*b^-1*arctanh(csc(a+b*x)^(1/2))+(1/2)*b^-1*csc(a+b*x)^-3//2*sec(a+b*x)^2)
@test integrate(csc(a+b*x)^(1/2)*sec(a+b*x)^4, x) == :(1//3*b^-1*csc(a+b*x)^-1//2*sec(a+b*x)^3+5//6*b^-1*csc(a+b*x)^-1//2*sec(a+b*x)+5//6*b^-1*csc(a+b*x)^(1/2)*sin(a+b*x)^(1/2)*Elliptic.F((1/2)*a+-1//4*pi+(1/2)*b*x,2))
@test integrate(csc(a+b*x)^-1//2*sec(a+b*x)^4, x) == :((1/2)*b^-1*csc(a+b*x)^-3//2*sec(a+b*x)+1//3*b^-1*csc(a+b*x)^-3//2*sec(a+b*x)^3+-1//2*b^-1*csc(a+b*x)^(1/2)*sin(a+b*x)^(1/2)*Elliptic.E((1/2)*a+-1//4*pi+(1/2)*b*x,2))
